/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:60px; }
/* site-body-background-size 
=========================*/
body { background-size:auto; }
/* site-body-background-pattern 
=========================*/
body:before { height:100%; background-image:url(); }
/* site-body-background-repeat 
=========================*/
body { background-repeat:no-repeat; }
/* site-body-background-position 
=========================*/
body { background-position:left top; }
/* site-body-background-attach 
=========================*/
body { background-attachment:scroll; }
/* content-typography 
=========================*/
body { font-family: "PT Sans";font-weight: regular; }
/* main-title-typography 
=========================*/
h1, h2, h3, h4, h5, h6, .aux-h1, .aux-h2, .aux-h3, .aux-h4, .aux-h5, .aux-h6 { font-family: "Oswald";font-weight: regular; }
/* page-title-typography 
=========================*/
.page-title { font-family: "Oswald";font-weight: 500; }
/* header-menu-typography 
=========================*/
.aux-master-menu { font-family: "Oswald";font-weight: regular; }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { height:65px; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#000000; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #ffffff;}
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:30px; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* vertical-menu-background-color 
=========================*/
.aux-vertical-menu { background-color:; }
/* vertical-menu-footer-background-color 
=========================*/
.aux-vertical-menu { background-color:; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:60px; }
/* sticky-header-color 
=========================*/
.site-header-section.aux-sticky, .aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { background-color:#FFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* portfolio-title-bar-overlay-pattern-opacity 
=========================*/
.single-portfolio .aux-overlay-bg-hash::before { opacity:0.5; }
/* news-title-bar-overlay-pattern-opacity 
=========================*/
.single-news .aux-overlay-bg-hash::before { opacity:0.5; }
/* buttons-typography 
=========================*/
.aux-button { font-family: "Oswald";font-weight: regular; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#ffffff;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* blog-post-like-icon-size 
=========================*/
.single-post .wp_ulike_general_class button::before { font-size:10px; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:10px; }
/* portfolio-single-share-button-icon-size 
=========================*/
.single-portfolio .aux-single-portfolio-share span::before { font-size:10px; }
/* portfolio-single-like-icon-size 
=========================*/
.single-portfolio .wp_ulike_general_class button::before { font-size:10px; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #ffffff;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #000000;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #3d3d3d;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: #aaaaaa;}
/* site-featured-color-5 
=========================*/
:root{--auxin-featured-color-5: #8a8a8a;}
/* site-featured-color-6 
=========================*/
:root{--auxin-featured-color-6: #37c891;}
/* body-typography 
=========================*/
body{ font-family:'PT Sans'; font-size:16px; font-weight:400; line-height:1.3em; } 
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Oswald'; font-size:26px; font-weight:600; line-height:1.2em; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Oswald'; font-size:14px; font-weight:700; line-height:1.2em; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Oswald'; font-size:15px; font-weight:400; line-height:1.2em; }

